USE Accounts 
GO

if exists (select * from sysobjects 
  where id = object_id('dbo.Accounts') and sysstat & 0xf = 3)
  drop table dbo.Accounts
GO

create table Accounts (
	AccountNo CHAR(12),
	Name VARCHAR(50),
	NRIC CHAR(9),
	Contact VARCHAR(20),
	PinNumber CHAR(6),
	AccountBalance MONEY,
	WithdrawalLimit MONEY,
	TransferLimit MONEY,
	AvgWithdrawal MONEY,
	TimesWithdrawn INT

	CONSTRAINT PK_Accounts PRIMARY KEY(AccountNo)
);

